import { Box, SimpleGrid } from '@chakra-ui/react'
import React from 'react'

export default function Images() {
    return (
<SimpleGrid minChildWidth="200px" spacing="40px"  mt='150'>
  <Box bg="tomato" height="200px" width='200px'></Box>
  <Box bg="tomato" height="200px" width='200px'></Box>
  <Box bg="tomato" height="200px" width='200px'></Box>
  <Box bg="tomato" height="200px" width='200px'></Box>
  <Box bg="tomato" height="200px" width='200px'></Box>
</SimpleGrid>
    )
}
